import React from 'react';
import { Text, StyleSheet, TouchableOpacity } from 'react-native';

const Deliveries = ({ deliveries }) => {

  const delivery = ({delivery}) => {
    <TouchableOpacity style={styles.row} onPress={() => navigation.navigate('Delivery', { id: delivery.id })}>
    <Text style={styles.loginText}>Delivery {delivery.id}</Text>
    <Text style={styles.loginText}>Store {delivery.store.name}</Text>
  </TouchableOpacity>
  }

  return(
    <FlatList
      data={deliveries}
      renderItem={delivery}
    />
)
}





export default Deliveries;

const styles = StyleSheet.create({
  container: {
    flex: 1,
    padding: 20,
    paddingTop: 20,
    paddingBottom: 20,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
  row: {
    backgroundColor: "#4169e1",
    width: "80%",
    height: 100,
    color: "#ffffff",
    textAlign: "center",
    justifyContent: "center",
    marginVertical: 5,
    padding: 5,
    borderRadius: 5
  }
});
